import './App.css';




function App() {
  return (
    <div className="container">
      <div className="header"></div>
      <div className="navi"></div>
      <div className="body">
        <div className="Section"></div>
        <div className="side"></div>
      </div>
      <div className="footer"></div>
    </div>
  );
}

export default App;
